import React from 'react';
import MyChart from './MyChart';
import { useNavigate } from 'react-router-dom';
import { Calendar, momentLocalizer } from 'react-big-calendar';
import moment from 'moment';
import 'react-big-calendar/lib/css/react-big-calendar.css';
import './components/main.css';

// Set up the localizer by providing the moment Object to the correct localizer.
const localizer = momentLocalizer(moment);

const MainMenu = () => {
  const navigate = useNavigate();

  // Sample events for the calendar
  const events = [
    {
      title: 'Event 1',
      start: new Date(2024, 8, 1),
      end: new Date(2024, 8, 1),
    },
    {
      title: 'Event 2',
      start: new Date(2024, 8, 5),
      end: new Date(2024, 8, 5),
    },
  ];

  return (
    <div className="main-container">
      <header className="header">
        <div className="dropdown-container">
          <select className="dropdown">
            <option>Assign Conductor</option>
            <option>Conductor 1</option>
            <option>Conductor 2</option>
          </select>
          <select className="dropdown">
            <option>Assign Inspector</option>
            <option>Inspector 1</option>
            <option>Inspector 2</option>
          </select>
        </div>
        <div className="profile-container" onClick={() => navigate('/profile')}>
          <img src="/profile.png" alt="Profile" className="profile-pic" />
        </div>
      </header>

      <div className="cards-container">
        <div className="card">
          <MyChart />
        </div>
        <div className="card calendar-card">
          <h3>Calendar</h3>
          <Calendar
            localizer={localizer}
            events={events}
            startAccessor="start"
            endAccessor="end"
            style={{ height: 500, margin: '20px' }}
          />
        </div>
      </div>
    </div>
  );
};

export default MainMenu;
